import { Box } from '@mui/system'
import React from 'react'
import CategoryButton from '../components/CategoryButton'
import MenuList from '../components/MenuList'

function subHeader() {
    return (
        <Box sx={{
            display: "flex",
            justifyContent: 'space-between'
        }}>
            <Box sx={{ ml:'2rem'}}>
                <CategoryButton/>
            </Box>
            <Box>
                <MenuList/>
            </Box>
        </Box>
    )
}

export default subHeader
